const Gallery = () => {

  return(
    <div className="main">
      <div className="cont">

      </div>
      <style jsx>{`
        .main{
          width: 100%;
        }
        .cont{
          width: 80%;
          height: 90%;
          background: ${color.prim};
        }
      `}
      </style>
    </div>
  )
}

const Main = ()=> {

  return(
    <div className="main">
      <Title word="top greenpost's" />
      <Gallery />
      <style jsx>{`
        .main{
          ${greenBackground()}
          height: 100vh;
        }
      `}
      </style>
    </div>
  )
}


export default Main;
